import React from 'react'
import { Button, Form } from 'react-bootstrap'

class Chat extends React.Component {


    render() {
        return (
        <div>
            <ul id="messages">
            </ul>
            <Form on>
                <Form.Control type="text" id="messageInput" autocomplete="off" /><Button variant="dark" type="submit">Send</Button>
            </Form>
        </div>
        )
    }

}

export default Chat
